#include <iostream>
#include <string>
using namespace std;
int main() {
    int n;
    string parity[] = {"Even", "Odd"};
    cin >> n;
    
    // Use the result of the modulo operation as an index
    // If n % 2 is 0, it selects parity[0] ("Even")
    // If n % 2 is 1, it selects parity[1] ("Odd")
    cout << parity[n % 2];
    
    return 0;
}
